  \"2015-01-22T15:36:38.381397\",\n\t\"name\": \"tiger-line-shapefile-2012-series-information-file-for-the-nation-current-combined-statistical-a\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation. Combined Statistical Areas (CSAs) are defined by the Office of Management
  and Budget (OMB) andn               consist of two or more adjacent Core Based Statistical
  Areas (CBSAs) that have significant employment interchanges. The CBSAs that combine
  to create an               CSA retain separate identities within the larger CSAs.
  Because CSAs represent groupings of CBSAs, they should not be ranked or compared
  with individualn               CBSAs.\",\n\t\"license_title\": null,\n\t\"extras\":
